import React from 'react';
import Navbar from '../components/NavBar';

function Contact() {
    return (
        <div>
            <Navbar/>
            <h1>Contact Page</h1>
            <p>Feel free to reach out through our contact form.</p>
        </div>
    );
}

export default Contact;
